import React from "react";
import Container from "./Container";
import Row from "./Row";
import Brian from "../images/brian.jpg";
import Peter from "../images/peter.jpeg";
import Bruce from "../images/bruce.jpeg";
import Chris from "../images/chris.jpg";
import Cleveland from "../images/cleveland.jpg";
import Consuela from "../images/consuela.png";
import Joe from "../images/joe.jpeg";
import Lois from "../images/lois.jpeg";
import Meg from "../images/meg.jpg";
import Mort from "../images/mort.jpg";
import Quagmire from "../images/quagmire.png";
import Stewie from "../images/stewie.jpg";
import Column from "./Column";
import Header from "./Header";
import Topfooter from "./Topfooter";

class Game extends React.Component {

    state = {
        count: 0,
        guessed: false,
        topScore: 0,
        imageArray: [Brian,]

    };

    gameCount = () => {

        this.setState({ count: this.state.count + 1 });


    };

    topScoreCount = () => {

        this.setState({ topScore: this.state.topScore + 1 });

    };

    render() {

        return (
            <div>
                <Topfooter count={this.state.count}/>
                <Header />
                <Container>
                    <Row>
                        <Column img={Brian} onClick={this.gameCount} />
                        <Column img={Peter} onClick={this.gameCount}/>
                        <Column img={Bruce} onClick={this.gameCount}/>
                        <Column img={Chris} onClick={this.gameCount}/>
                    </Row>
                    <Row>
                        <Column img={Cleveland} onClick={this.gameCount}/>
                        <Column img={Consuela} onClick={this.gameCount}/>
                        <Column img={Joe} onClick={this.gameCount}/>
                        <Column img={Lois} onClick={this.gameCount}/>
                    </Row>
                    <Row>
                        <Column img={Meg} onClick={this.gameCount}/>
                        <Column img={Mort} onClick={this.gameCount}/>
                        <Column img={Quagmire} onClick={this.gameCount}/>
                        <Column img={Stewie} onClick={this.gameCount}/>
                    </Row>
                </Container>
            </div>
        )
    }
}
export default Game;
